            <description><![CDATA[<p class="nico-memo">打ち切りになりました　ごめんなさい！</p><p class="nico-thumbnail"><img alt="【スカイリム】鬼道戦士カテジナ!! 最終回・お知らせ【ゆっくり実況 】" src="http://tn-skr3.smilevideo.jp/smile?i=17614094" width="94" height="70" border="0"/></p><p class="nico-description">打ち切りです(笑) ごめんなさい！　ハーフィンガルの解放が進まなくなりました。ネットで調べてみると結構あるみたいですねこのバグ……愕然としている中、新しいPCとPC版スカイリムが届いたので、こちらに切り替えます。長い間カテジナさんを応援してくださったみなさん、ありがとうございました！次回作でもよろしくお願いします！＊メンチはどこかで使います！新作オープニングの曲はこちらからお借りしました→sm13500891前→sm17342597　次→打ち切り内戦編マイリスト→mylist/30544641　闇の一党編マイリストmylist→mylist/29776641ゆっくりまとめコミュ→co1653398　ゆっくりPART1まとめ→mylist/32098741ブログ→http://ameblo.jp/katejinanico/</p><p class="nico-info"><small><strong class="nico-info-length">5:07</strong>｜<strong class="nico-info-date">2012年04月22日 10：10：23</strong> 投稿</small></p><p class="nico-numbers"><small>再生：<strong class="nico-numbers-view">17,111</strong>&nbsp;&#x20;コメント：<strong class="nico-numbers-res">248</strong>&nbsp;&#x20;マイリスト：<strong class="nico-numbers-mylist">59</strong></small></p>]]></description>
