            <description><![CDATA[<p class="nico-memo">PART3　今日もCoolなPartyだったぜ！</p><p class="nico-thumbnail"><img alt="【スカイリム】鬼道戦士カテジナ!! PART3【ゆっくり実況 】" src="http://tn-skr2.smilevideo.jp/smile?i=17273233" width="94" height="70" border="0"/></p><p class="nico-description">今日はCoolなPartyでお送りするぜ！　間隔が開いてしまいましたね。Ａ９にちょっと浮気をしていました…花粉が始まってたいへんです。クロノクルの防塵マスクが欲しい今日この頃。OPをちょこっと変えてみました。では、今回もどうぞご覧ください！＊注意１．スカイリムの世界観を壊すおそれがあります。２．言うほどカテジナ要素はありません。３．実はアニメにはくわしくないです。前→sm17082356　次→sm17342597内戦編マイリスト→mylist/30544641　闇の一党編マイリストmylist→mylist/29776641ゆっくりまとめコミュ→co1653398　ゆっくりPART1まとめ→mylist/32098741ブログ→http://ameblo.jp/katejinanico/</p><p class="nico-info"><small><strong class="nico-info-length">14:58</strong>｜<strong class="nico-info-date">2012年03月17日 10：09：06</strong> 投稿</small></p><p class="nico-numbers"><small>再生：<strong class="nico-numbers-view">19,504</strong>&nbsp;&#x20;コメント：<strong class="nico-numbers-res">539</strong>&nbsp;&#x20;マイリスト：<strong class="nico-numbers-mylist">90</strong></small></p>]]></description>
